import React, { Component } from 'react'
import Listitem from './Listem'

export default class List extends Component {
  componentDidMount(){
    setTimeout(() => {
    // console.log(this.props.users);
      
    }, 2000);
  }
  render() {
    return (
      <div className="row">
        {
          this.props.isfirst.users?<h2>Welcome to use, please enter the keyword</h2>:
          this.props.isloading.users?<h2>Loading......</h2>:
          this.props.err.users?<h2>{this.props.err}
          </h2>:
          this.props.users.map((a) => {

            return (
             <Listitem key={a.id} users={a} />
            )
            

          })

        }
      </div>
    )
  }
}
